import React from 'react';
import './Header2.css'; // Подключаем стили модуля

const HeaderPart2 = () => {
  return (
    <div className="header-part2-container">
      <div className="logo-container">
        {/* Иконка (замените на вашу иконку) */}
        <img src="/path/to/location-icon.svg" alt="Location" onClick={handleLocationClick} />
        {/* Текст "AVT-ZAP" (сделаем кликабельным) */}
        <p className="subtext" onClick={handleLocationClick}>Интернет-магазин запчастей для АКПП</p>
      </div>
      <div className="working-hours-container">
        {/* Иконка (замените на вашу иконку) */}
        <img src="/path/to/whatsapp-icon.svg" alt="WhatsApp" onClick={handleWhatsAppClick} />
        {/* Текст "Мы работаем: будни - 9:00-21:00" (сделаем кликабельным) */}
        <p className="subtext" onClick={handleWhatsAppClick}>Мы работаем: будни - 9:00-21:00</p>
        <div className="green-rectangle" onClick={handleWhatsAppClick}>
          {/* Иконка (замените на вашу иконку) */}
          <img src="/path/to/whatsapp-icon.svg" alt="WhatsApp" />
          {/* Текст "Напишите нам в WhatsApp" */}
          <p>Напишите нам в WhatsApp</p>
        </div>
        {/* Телефонный номер (сделаем кликабельным) */}
        <p className="contact-info" onClick={handleWhatsAppClick}>+7 383 291 92 86</p>
        {/* Форма обратной связи (сделаем кликабельным) */}
        <p className="feedback-info" onClick={handleFeedbackClick}>Форма обратной связи</p>
      </div>
    </div>
  );
};

export default HeaderPart2;
